INSERT INTO `course` (`id`, `days`, `description`, `duration`, `is_active`, `name`, `syllabus`) VALUES (1, 'Mon-Fri', 'This AI for Medical Diagnosis program offered by Coursera in partnership with Deeplearning is part of the AI for Medicine Specialization.', 15, 0, 'Medical Diagnosis', '- Disease detection with computer vision - Evaluating models - FImage segmentation on MRI images');
INSERT INTO `course` (`id`, `days`, `description`, `duration`, `is_active`, `name`, `syllabus`) VALUES (2, 'Mon-Fri', 'Newborn Baby care skills . Gain skills in newborn baby care, safety, & health including breastfeeding, safe sleep, & screenings with this Newborn Baby Care offered by Coursera in partnership with University of Colorado System.', 120, 0, 'Newborn Baby Care', '- Preventative Healthcare for the Newborn Baby - The Newborn Assessment - Guidance to Keep Newborn Babies Safe and Healthy - Supporting Parents of a Newborn Baby - Newborn Capstone');
INSERT INTO `course` (`id`, `days`, `description`, `duration`, `is_active`, `name`, `syllabus`) VALUES (3, 'Mon-Fri', 'In this Positive Psychiatry and Mental Health course offered by Coursera in partnership with The University of Sydney, we will explore different aspects of good mental health as well as provide an overview of the major kinds of mental disorders, their causes, treatments and how to seek help and support.', 20, 0, 'Psychiatry and Mental Health', '- Positive mental health and Psychiatry - Body and Mind - Love and Work - Mental Illness - Paths to Recovery');
INSERT INTO `course` (`id`, `days`, `description`, `duration`, `is_active`, `name`, `syllabus`) VALUES (4, 'Mon-Fri', 'The modules of the Dental Assistant course from International Open Academy have been created to help you better understand both how to enter the field, and what will be expected of you once you do.', 40, 0, 'Dental Assistant', '- Diversity of dental assistants/nurses - Potential for growth - Pre-planning for a career as a dental assistant/nurse');
INSERT INTO `course` (`id`, `days`, `description`, `duration`, `is_active`, `name`, `syllabus`) VALUES (5, 'Mon-Fri', 'Begin a rewarding career as a physiotherapy assistant where you can make a meaningful difference in the lives of people in need. Upon completing this Physiotherapy Assistant course from International Open Academy in becoming a physiotherapy assistant', 30, 0, 'Physiotherapy Assistant', '- Duties of a physiotherapist - Specialties within the physiotherapy field - Working with clients with various heath care needs - Ethical responsibilities of the profession');
INSERT INTO `course` (`id`, `days`, `description`, `duration`, `is_active`, `name`, `syllabus`) VALUES (6, 'Sat-Sun', 'This Medical Technology and Evaluation offered by Coursera in partnership with University of Minnesota is part of the Healthcare Marketplace Specialization.', 20, 0, 'Technology and Evaluation', '- Clinical Trials and Insurance Claims Data - The Elements of Medical Technology Assessments - Methodological Approaches and Considerations');
INSERT INTO `course` (`id`, `days`, `description`, `duration`, `is_active`, `name`, `syllabus`) VALUES (7, 'Mon-Fri', 'Are you keen to take your nursing career to a higher level? This 100% online and part-time Nursing short course from University of Essex Online is designed for practicing nurses who want to continue their professional development.', 160, 0, 'Nursing', '- Healthcare Management: Principles and Practices - Healthcare Leadership in Practice - Diabetes: Prevention, Care and Management - Meeting the Needs of Vulnerable Patients');
INSERT INTO `course` (`id`, `days`, `description`, `duration`, `is_active`, `name`, `syllabus`) VALUES (8, 'Sat-Sun', 'EdX is an online learning platform trusted by over 12 million users offering the Food, Nutrition and Health in collaboration with Wageningen University and Research - WageningenX. Learn the truth about food and nutrition.', 80, 0, 'Food, Nutrition and Health', '- Nutrition and Health: Macronutrients and Overnutrition - Nutrition and Health: Micronutrients and Malnutrition');
INSERT INTO `course` (`id`, `days`, `description`, `duration`, `is_active`, `name`, `syllabus`) VALUES (10, 'Mon-Fri', 'Beauty & Wellness course aims to provide students with the skills and knowledge to provide a range of beauty and wellness treatments, promote beauty products to client, and handle the daily operation of a salon', 40, 0, 'Makeup Artist', '- Basic Makeup - Basic Nail Care - Basic Facial - Facial & Waxing Treatment');
INSERT INTO `course` (`id`, `days`, `description`, `duration`, `is_active`, `name`, `syllabus`) VALUES (11, 'Mon-Fri', 'Hair Fashion & Design course provides students with the skills and knowledge in haircutting, hair perming, hair colouring, hairstyling, hair and scalp care, as well as salon operations and customer service', 60, 0, 'Hair Fashion & Design', '- Shampoo and Head Massage - Basic Haircutting - Basic Hairstyling - Advanced Hair Colouring');
INSERT INTO `course` (`id`, `days`, `description`, `duration`, `is_active`, `name`, `syllabus`) VALUES (13, 'Mon-Fri', 'Participants will learn more about the agricultural technologies for food production, farming process and management, urban farming technology and systems, agribusiness and sustainable farming.', 80, 0, 'Urban Agricultural Technology', '- Design, Operation and Management of Urban Farms - Traceability of Farm Produce - Disease: Causes and Identification - Managing the Natural Resource Base for Farming');
INSERT INTO `course` (`id`, `days`, `description`, `duration`, `is_active`, `name`, `syllabus`) VALUES (15, 'Mon-Fri', 'This course is designed for participants to acquire plumbing skills and opportunity to upgrade to Trades Foreman / Tradesman through our training.', 20, 0, 'Plumbing & Pipefitting', '- General Knowledge of Cold water Systems and Plumbing Fittings - General Knowledge of Sanitary Plumbing and Vent Pipe System - Installation of Pipe & Fittings Installation / connection - Installation of Sanitary Fittings - Awareness on safety');